import { createRouter, createWebHistory } from 'vue-router'
//import HomeView from '../views/HomeView.vue'
import Index from '../views/Index'
import Books from '../views/Books'
import Author from '../views/books/Author'
import NewsBoard from '../views/board/News'
import NewsInner from '../views/board/_NewsInner'
import Login from '../views/login/Login'
import Singup from '../views/login/Singup'
import Join from '../views/login/Join'

const routes = [
  {
    path: '/',
    name: 'index',
    component: Index
  },
  {
    path: '/Books',
    name: 'Books',
    component: Books
  },
  {
    path: '/Author',
    name: 'Author',
    component: Author
  },
  {
    path: '/NewsBoard',
    name: 'NewsBoard',
    component: NewsBoard
  },
  {
    path: '/NewsBoard/news',
    //path: '/NewsBoard/news/:id',
    name: 'NewsInner',
    component: NewsInner
  },
  {
    path: '/Login',
    name: 'Login',
    component: Login
  },
  {
    path: '/Singup',
    name: 'Singup',
    component: Singup
  },
  {
    path: '/Join',
    name: 'Join',
    component: Join
  },
]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
